package org.walkframework.base.system.task.notify;import java.io.Serializable;  public class NotifyReq implements Serializable {	private static final long serialVersionUID = 1L;	 /**		 *通知流水		 */		private String notifyId;	 /**		 *通知对象编码		 */		private String objectCode;	 /**		 *通知对象类型	 */		private String objectType;	 /**		 *业务平台编码	 */		private String serviceId;	 /**		 *通知内容		 */		private String notifyContent;	 /**		 *通知地址。当通知模式为消息时该字段为消息频道编码；当通知模式为URL通知时该字段为业务平台提供的通知URL；		 */		private String notifyAddr;	public String getNotifyId() {		return notifyId;	}	public void setNotifyId(String notifyId) {		this.notifyId = notifyId;	}	public String getObjectCode() {		return objectCode;	}	public void setObjectCode(String objectCode) {		this.objectCode = objectCode;	}	public String getObjectType() {		return objectType;	}	public void setObjectType(String objectType) {		this.objectType = objectType;	}	public String getServiceId() {		return serviceId;	}	public void setServiceId(String serviceId) {		this.serviceId = serviceId;	}	public String getNotifyContent() {		return notifyContent;	}	public void setNotifyContent(String notifyContent) {		this.notifyContent = notifyContent;	}	public String getNotifyAddr() {		return notifyAddr;	}	public void setNotifyAddr(String notifyAddr) {		this.notifyAddr = notifyAddr;	}}